/*Table structure for table `ticket_order` */

DROP TABLE IF EXISTS `ticket_order`;

CREATE TABLE `ticket_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `person_id` int(11) NOT NULL COMMENT '用户id',
  `ticket_id` int(11) NOT NULL COMMENT '对应的车票',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '订单的状态0 1 2未完成',
  `create_time` datetime NOT NULL COMMENT '订单创建的时间',
  `price` float DEFAULT NULL COMMENT '用户支付的价格',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `ticket_order` */

/*Table structure for table `trips` */

DROP TABLE IF EXISTS `trips`;

CREATE TABLE `trips` (
