  `reach_time` datetime NOT NULL,
  `car_num` varchar(8) NOT NULL,
  `ticket_price` int(6) NOT NULL,
  `ticket_num` int(4) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

